        explanation:
          '<div><img src="data:image/png;base64," /></div>Explanation:<br />Scenario: If a user enters a Social Security number in an email message addressed to an external recipient, the user must receive a notification before sending the message. If the user sends the message, the message must not be delivered. A compliance officer must be notified of the violation.',
